  <script>
    // Wait for the DOM content to be loaded
    document.addEventListener("DOMContentLoaded", function() {
      // Select all paths within the SVG
      const paths = document.querySelectorAll('svg path');
	// Add class "path" to each path
    paths.forEach(path => {
      path.classList.add('path');
    });
      // Loop through each path and animate
      paths.forEach((path, index) => {
	const length = path.getTotalLength();
      
      // Set initial styles
      path.style.strokeDasharray = length;
      path.style.strokeDashoffset = length;
      

        setTimeout(() => {
          path.style.strokeDashoffset = 0;
          path.style.fillOpacity = 1; // Show fill
          path.style.transition = 'stroke-dashoffset 0.5s ease-in-out';
	  path.style.strokeDashoffset = '0';
        }, index * 60); // Adjust timing (decreased from 1000 to 500 for faster animation)
      });
    });
  </script>
